import React from 'react'

function ProductCard(props) {
    return (
        <div className="border mb-4 rounded overflow-hidden">
            {props.product.title}
            {props.product.price}
            {props.products.image}
            {/* <div><img 
           src={props.products.image}
           alt={props.products.title}
           /></div> */}
        </div>
       
    )
}

export default ProductCard
